import React from 'react'
import './Portfolio.css'
import Sidebar from '../../img/sidebar.png'
import Ecommerce from '../../img/ecommerce.png'
import HOC from '../../img/hoc.png'
import MusicApp from '../../img/musicapp.png'
import{Swiper, SwiperSlide} from 'swiper/react'
import {Pagination} from 'swiper'
import 'swiper/css/pagination'
import 'swiper/css'

import 'swiper/css'
const Portfolio = () => {
    const projects=[{
        img: Sidebar,
        about:"Centenario App project developed using Android Studio+ Java"
    },
    {
        img: Ecommerce,
        about:"Centenario App project developed using Android Studio+ Java"
    },
    {
        img: HOC,
        about:"Centenario App project developed using Android Studio+ Java"
    },
    {
        img: <MusicApp></MusicApp>,
        about:"Centenario App project developed using Android Studio+ Java"
    },
    ]
  return (
    <div className="p-wrapper">
        <div className="p-heading">
            <span>Recently Worked on varios projects</span>
            <div className="blur p-blur1" style={{background:'var(--purple'}}></div>
            <div className="blur p-blur2" style={{background:'skyblue'}}></div>
            {/* slider */}
            <Swiper
            modules={{Pagination}}
            slidesPerView={1}
            pagination={{clickable:true}}
            >
                {projects.map((projects, index)=>{
                    return(
                    <SwiperSlide key={index}>
                        <div className="portfolio">
                        <img src={projects.img} alt=''></img>
                        <span>{projects.about}</span>
                        </div>
                    </SwiperSlide>
                    )
                })}
            </Swiper>

        </div>

    </div>
    // <div className="portfolio">
    //     <span>Recent Project</span>
    //     <span>Portfolio</span>
    //     {/* slider */}
    //     <Swiper
    //     spaceBetween={30}
    //     slidesPerView={3}
    //     grabCursor={true}
    //     className='portfolio-slider'
    //     >
    //         <SwiperSlide>
    //             <img src={Sidebar}></img>
    //         </SwiperSlide>
    //         <SwiperSlide>
    //             <img src={Ecommerce}></img>
    //         </SwiperSlide>
    //         <SwiperSlide>
    //             <img src={HOC}></img>
    //         </SwiperSlide>
    //         <SwiperSlide>
    //             <img src={MusicApp}></img>
    //         </SwiperSlide>
    //     </Swiper>
    // </div>
  )
}

export default Portfolio
